        private List<string> _description = new List<string>() {
            "Macaron là một loại bánh ngọt nổi tiếng của Pháp được làm từ lòng trắng trứng, đường bột, đường cát, bột hạnh nhân và thêm màu thực phẩm. Nhân bánh thường được lấp đầy với mứt, ganache hoặc kem bơ kẹp giữa hai mặt bánh.",
            "Bánh táo được xem là biểu tượng của nền văn hóa ẩm thực Mỹ, thể hiện sự thịnh vượng và là niềm tự hào trong suốt những năm của thế kỷ 19 và 20 của đất nước này. Bánh táo Mỹ với phần vỏ bánh mỏng, giòn mềm, ẩn chứa phần nhân táo thơm ngọt, điểm chút vị chua dịu của trái cây quả sẽ là một lựa chọn hoàn hảo cho những tín đồ bánh ngọt trên toàn thế giới.",
            "Pavlova được sử dụng nguyên liệu là bột ngô nên loại bánh này rất xốp và mềm bên trong nhưng lại khá là giòn phần bên ngoài vỏ bánh, bánh có vị ngọt nhẹ gần giống với bánh trứng đường. Bánh Pavlova có một lớp hoa qua tươi bên ngoài làm tăng thêm hương vị thơm ngon khó cưỡng.",
            "Chiếc bánh carac của Thụy Sĩ đặc biệt hấp dẫn và sang trọng, là một mặt hàng nổi bật trên hầu hết các cửa hiệu bánh ngọt ở Thụy Sĩ. Vỏ của chiếc bánh tart nhỏ bé này được làm từ chocolate ganache đen, hạt hạnh nhân nghiền nhuyễn trong khi bề mặt của chiếc bánh được phủ một lớp đường đông lạnh màu xanh ngọc rất bắt mắt.",
            "Mochi là món ăn truyền thống trong ngày tết rất được người Nhật yêu thích, tượng trưng cho sự may mắn và thịnh vượng trong năm mới. Nhân bánh có thể làm từ đậu đỏ, đậu trắng hoặc dâu tây hay một số loại hoa quả khác kết hợp với đậu đỏ.",
            "Black Forest là tên một loại bánh, một món tráng miệng, có nguồn gốc từ Đức. Bánh bao gồm nhiều lớp bánh bông lan chocolate xen giữa các lớp kem tươi trộn với anh đào, sau đó được phủ một lớp kem tươi lên trên, rồi trang trí bằng quả anh đào đen và chocolate bào vụn.",
            "Đây là món ăn vặt khá phổ biến ở Brazil. Bánh là bột mì cán mỏng nướng giòn, khi ăn sẽ được kẹp với nhân kem, chuối, pho mát, chocolate. Khi ăn vào, bạn sẽ cảm nhận hương vị lạ miệng với nhân bánh mềm, vỏ bánh, vị chocolate thơm ngọt nhẹ... ",
            "Bánh Crepe với nhiều công thức khác nhau là món ăn hoàn hảo cho mọi hoàn cảnh: bữa sáng, món khai vị cho bữa trưa, món tráng miệng cho bữa tối. Có nhiều loại bánh Crepe khác nhau, loại truyền thống được làm từ đường và cốt chanh nhưng loại bánh Crepe nổi tiếng và dễ “vào” nhất chính là bánh Crepe với kem Sô cô la và chuối.",
            "Tiramisu là món tráng miệng đẳng cấp trong nền ẩm thực Ý và trở thành món ăn phổ biến nhất trong nhiều nhà hàng tại Châu Âu. Bánh là sự kết hợp hài hòa giữa rượu nhẹ marsala, trứng, kem phô mai mascarpone và café. Khi thưởng thức, vị bánh mềm mại như tan chảy đều trên đầu lưỡi nhưng vẫn mang vị xốp của bánh gato.",
            "Hàn Quốc nổi tiếng là xứ sở của những chiếc bánh gạo Gyeongdan thơm ngon và đặc biệt mang nhiều ý nghĩa trong truyền thống văn hóa con người đất nước này.",
            "Sachertorte là một loại bánh xốp được tạo ra bởi loại chocolate tuyệt hảo nhất của nước Áo. Sachertorte có vị ngọt nhẹ, gồm nhiều lớp bánh được làm từ ruột bánh mì và bánh sữa chocolate, xen lẫn giữa các lớp bánh là mứt mơ.",
            "Đây là loại bánh được đặt theo tên của nữ hoàng Anh Victoria. Một chiếc Victoria Sponge truyền thống gồm mứt và lượng kem nhiều gấp đôi. Bánh thường được dùng trong tiệc trà chiều của người Anh.",
