        #endregion
        #region Properties


        private string _cakeName;
        public string CakeName { get => _cakeName; set { _cakeName = value; OnPropertyChanged(); } }

        private string _cakeDescription;
        public string CakeDescription { get => _cakeDescription; set { _cakeDescription = value; OnPropertyChanged(); } }

        private byte[] _imageCover;
        public byte[] ImageCover { get => _imageCover; set { _imageCover = value; OnPropertyChanged(); } }


        //public Global globalTheme = Global.GetInstance();

        public ICommand ChangeShow { get; set; }
        public ICommand LoadedWindowCommand { get; set; }
        public int ProgressBarValue { get => _progressBarValue; set { _progressBarValue = value; OnPropertyChanged(); } }
        #endregion
        public SplashScreenViewModel()
        {
            int randomnum = MyRandom.Ins.Next(_name.Count);
            CakeName = _name[randomnum];
            CakeDescription = _description[randomnum];
            ImageCover = System.Text.Encoding.Default.GetBytes((_image[randomnum] == null) ? _defaultImage : _image[randomnum]
                );
            LoadedWindowCommand = new RelayCommand<Window>((prop) => { return true; }, (splash) =>
            {
                splash.Hide();
                var value = ConfigurationManager.AppSettings["ShowSplashScreen"];
                bool showSplash = bool.Parse(value);
                if (showSplash == false)
                {
                    if (MainViewModel.IsShowed == false)
                    {
                        MainWindow mW = new MainWindow();
                        mW.Show();
                        MainViewModel.IsShowed = true;
                    }
                    splash.Close();
                }
                else
                {
                    splash.Show();
                    dT.Elapsed += dt_Tick;
                    dT.Start();
                }

            });

            ChangeShow = new RelayCommand<object>((param) => { return true; }, (param) => {
                var value = ConfigurationManager.AppSettings["ShowSplashScreen"];
                bool showSplash = bool.Parse(value);
                var config = ConfigurationManager.OpenExeConfiguration(
                ConfigurationUserLevel.None);
                config.AppSettings.Settings["ShowSplashScreen"].Value = (!showSplash).ToString();
                config.Save(ConfigurationSaveMode.Minimal);

                ConfigurationManager.RefreshSection("appSettings");
            });
        }

        void dt_Tick(object sender, EventArgs e)
        {
            ProgressBarValue += Interval;
            if (ProgressBarValue >= _time_SplashScreen)
            {
                dT.Dispose();
            }
            else
            {
                dT.Start();
            }

        }
    }
